import React, { Component } from "react";
import { Link } from "react-router-dom";
import {
  Button,
  Dimmer,
  Header,
  Icon,
  Image,
  Segment,
  Grid,
  Form,
  Message,
  Container,
  Divider
} from "semantic-ui-react";
import logo from "../images/Login_Signup/logo.jpg";

class Home extends Component {
  render() {
    return (
      <Container fluid className="main">
        <Container as="h1" textAlign="center">
          Welcome to OverTrack
        </Container>
        <Divider />
        <Grid columns={2} verticalAlign="top">
          <Grid.Row verticalAlign="top" />
          <Grid.Column>
            <Button className="homebutton centered">Record A Game</Button>
          </Grid.Column>

          <Grid.Column>
            <Button className="homebutton">View Match History</Button>
          </Grid.Column>
        </Grid>
        <Grid>
          <Grid.Column>
            <Container as="h2" textAlign="center">
              News
            </Container>
            <Divider />
          </Grid.Column>
        </Grid>
      </Container>
    );
  }
}

export default Home;
